import React from "react";

const ImageHoverZoom = ({ imagePath }) => {
    return (
        <div className="img-wrapper">
            <img
                src={imagePath}
                alt="product image"
                className="hover-zoom img-fluid"
            />
        </div>
    );
    };
    export default ImageHoverZoom;
